import './App.css';
import StrokedText from './StrokedText';
import MenuDiv from './MenuDiv'

function App() {
  let s = ""
  const length = 0.1
  for (let i = 0; i < 360; i++) {
    s = s + Math.sin(i/360*2*Math.PI)*length + "vw " + Math.cos(i/360*2*Math.PI)*length + "vw 0 black, "
  }
  console.log(s)

  return (
    <div style={{textAlign: "center"}}>
      <StrokedText  width="70vw" height="30vw" left="15vw" top="0vw" text="Zombie Fighter Redux"/>
      <div style={{display: "flex", alignItems: "center", height: "100vh", paddingTop: "15vw", boxSizing: "border-box", justifyContent: "center"}}>
        <MenuDiv title="Global Leaderboard"></MenuDiv>
      </div>
    </div>
  );
}

export default App;
